import React, { useEffect } from 'react';

const ParticleRainImg = () => {
    const img = new Image();
    img.src = 'data:image/png;base64,'
    
    useEffect(() => {
        CreateCanvas();
    }, []);

    function CreateCanvas() {
        const canvas = document.getElementById('canvas');
        canvas.width = 334;
        canvas.height = 457;
        const ctx = canvas.getContext('2d');

        ctx.drawImage(img, 0, 0, canvas.clientWidth, canvas.clientHeight);
        const pixels = ctx.getImageData(0, 0, canvas.clientWidth, canvas.clientHeight);

        let particlesArray = [];
        const numberOfParticles = 5000;

        let mappedImage = [];
        for (let y = 0; y < canvas.clientHeight; y++) {
            let row = [];
            for (let x = 0; x < canvas.clientWidth; x++) {
                const red = pixels.data[(y * 4 * canvas.clientWidth) + (x * 4)];
                const green = pixels.data[(y * 4 * canvas.clientWidth) + (x * 4 + 1)];
                const blue = pixels.data[(y * 4 * canvas.clientWidth) + (x * 4 + 2)];
                const brightness = calculateRelativeBrightness(red, green, blue);
                const cell =  [
                    brightness
                ];
                row.push(cell);
            }
            mappedImage.push(row);
        }

        function calculateRelativeBrightness(red, green, blue) {
            return Math.sqrt(
                (red * red) * 0.299 +
                (green * green ) * 0.587 + 
                (blue * blue) * 0.114
            )/100;
        }

        class Particle {
            constructor() {
                this.x = Math.random() * canvas.clientWidth;
                this.y = 0;
                this.speed = 0;
                this.velocity = Math.random() * 0.5;
                this.size = Math.random() * 0.5;
                this.position1 = Math.floor(this.y);
                this.position2 = Math.floor(this.x);
            }
            update() {
                this.position1 = Math.floor(this.y);
                this.position2 = Math.floor(this.x);
                this.speed = mappedImage[this.position1][this.position2][0];
                let movement = (2.5 - this.speed) + this.velocity;

                this.y += movement;
                if (this.y >= canvas.clientHeight) {
                    this.y = this.size;
                    this.x = Math.random() * canvas.clientWidth;
                }
            }
            draw() {
                ctx.beginPath();
                ctx.fillStyle = 'white';
                ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2);
                ctx.fill();
            }
        }
        
        (function init() {
            for (let i=0; i<numberOfParticles; i++) {
                particlesArray.push(new Particle());
            }
        })();
        function animate() {
            ctx.globalAlpha = 0.05;
            ctx.fillStyle = 'rgb(0, 0, 0)';
            ctx.fillRect(0, 0, canvas.clientWidth, canvas.clientHeight);
            particlesArray.map(particle => {
                particle.update();
                ctx.globalAlpha = particle.speed * 0.5;
                particle.draw();
            });
            requestAnimationFrame(animate);
        }
        animate();
    }

    return (
        <canvas id='canvas' className='w-fit self-center mb-10'></canvas>
    );
}

export default ParticleRainImg;
